package com.cs.ioc;/** * @author: demopoo * @Date: Created in 下午5:00 2018/3/19 * @Des: * @Modifyed By: */public class PropertyItem {    /**     * 属性名称     */    private String propertyName;    /**     * 属性值     */    private Object propertyObject;    public PropertyItem(String propertyName,Object propertyObject){        this.propertyName = propertyName;        this.propertyObject = propertyObject;    }    public String getPropertyName() {        return propertyName;    }    public void setPropertyName(String propertyName) {        this.propertyName = propertyName;    }    public Object getPropertyObject() {        return propertyObject;    }    public void setPropertyObject(Object propertyObject) {        this.propertyObject = propertyObject;    }}